DROP TABLE IF EXISTS osm_countries;
CREATE TABLE osm_countries (
    osm_id INTEGER,
    iso_code varchar(2),
    name varchar(100),
    name_en varchar(100),
    name_de varchar(100),
    name_fr varchar(100),
    name_es varchar(100),
    name_ru varchar(100),
    name_zh varchar(100),
    scalerank integer,
    geometry geometry,
    id integer primary key
);


ALTER TABLE osm_countries ALTER COLUMN geometry TYPE geometry USING ST_Transform(geometry, 900913);
SELECT UpdateGeometrySRID('osm_countries', 'geometry', 900913);
